В продаже 45 соток около ТЦ Мега (на обратной стороне). Территориально участок относится к городу Аксаю. В собственности. Идеально подойдет под склад, объекты торговли и др. На фото показано варианты въезда-выезда на участок (официальный документ). Категория земель: Земли населенных пунктов. Есть документация по разработке проекта планировки и проекта межевания территории большого соседнего земельного участка (по запросу вышлю), которые уже будут строить ск ССК (участки уже распланированы). Цена-27 млн.р. Можно продать 120 соток.

 Находится в зоне коммерческого назначения (КТ). По основным видам разрешенного ис-пользования на участке можно строить: 
1) Магазины и объекты торговли; 
2) Гостиничное обслуживание; 
3) Деловое управление; 
4) Обслуживание перевозок пассажиров; 
5) Религиозное использование. 
По условно разрешённым видам использования можно строить: 
1) Склады;
 2) Бытовое обслуживание; 
3) Развлекательные мероприятия.


